import React from "react";

const UpdateLiveStats = () => {
  return (
    <div>
      <div className="view overlay">
        <p className="text-muted  rgba-green-slight">Updated AT 21 April</p>
      </div>
      <div class="view overlay">
        <img
          src="https://mdbootstrap.com/img/Photos/Others/forest-sm.jpg"
          class="img-fluid "
          alt="smaple image"
        />
        <div class="mask flex-center rgba-green-slight">
          <p class="white-text">Super light overlay</p>
        </div>
      </div>
    </div>
  );
};

export default UpdateLiveStats;
